const CreateCv = () => {
  return (
    <div className="container flex h-32 bg-[#262626] font-semibold  text-white rounded-lg items-center align-middle space-x-3">
      <div className="self-start p-5 font-Osland text-3xl space-x-2">

        <span></span>CV Creator   
        <button
          type="button"
          className=" text-white shadow-2xl text-base  bg-teal-600  font-medium rounded-lg px-5 py-2.5 "
        >
          Save
        </button>
        <button
          type="button"
          className=" text-white shadow-2xl  bg-teal-600 text-base font-medium rounded-lg text-ms px-5 py-2.5 "
        >
          Save
        </button>
      </div>


    </div>
  );
};

export default CreateCv;
